    the state of Kentucky at a 50 meter height.rnrnThis data set has been validated
    by NREL and wind energy meteorological consultants. However, the data is not suitable
    for micro-siting potential development projects. This shapefile was generated from
    a raster dataset with a 200 m resolution, in a UTM zone 12, datum WGS 84 projection
    system.rnrnThe wind power resource estimates were produced by TrueWind Solutions
